import React from "react";

class Output extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    const { state } = this.props;

    return (
      <div className="output">
        <header>My CV</header>
        <div className="cv-content">
          <p>
            My name is {state.name} {state.lastName}
          </p>
        </div>
      </div>
    );
  }
}

export default Output;
